import Home from "./pages/Home/Home";

const App = () => {
    return (
        <div className="App">
            <Routes>
                <Route path="/" element={<Layout />}>
                    <Route index element={<Home />} />
                    <Route path="home" element={<Home />} />
                    <Route path="search" element={<Search />} />
                </Route>
                <Route path="/auth" element={<Login />} />
                <Route path="*" element={<Error />} />
            </Routes>
        </div>
    );
};

export default App;
